import "./quotetable.css"
import React, { Component } from 'react'

export class QuoteTable extends Component {

    // Temp state var until I implement Redux
    // for table rows
    state = {
        rows: []
    }

    handleChange = idx => e=> {
        const {name, value} = e.target;
        const rows = [...this.state.rows];
        rows[idx] = {
            [name]: value
        };
        this.setState({
            rows
        })
    }
    render() {
        const heading = [
            {
                id: 0,
                label: "Quote Data"
            },
            {
                id: 1,
                label: "Gallons"
            },
            {
                id: 2,
                label: "Delivery Date"
            },
            {
                id: 3,
                label: "PPG"
            },
            {
                id: 4,
                label: "Total"
            }];

        return (
            <div className="table-container">
                <table className="quote-table">
                    <thead>
                        <tr key="head" >
                            {heading.map((item, key) => {
                                return (
                                    <td key={key}><center>{item.label}</center></td>
                                )
                            })}
                        </tr>
                    </thead>
                    <tbody>
                        {this.props.tableData.map((item, key) => {
                            return (
                                <tr key={key} >
                                    <td><center>{item.name}</center></td>
                                    <td>{item.age}</td>
                                </tr>
                            )
                        })}
                    </tbody>
                </table>
            </div >
        )
    }
}

export default QuoteTable
